import axios from 'axios'
import { useState } from 'react'


const MatchDisplay = ({matches}) => {

	const [matchedProfiles,setMatchedProfile] = useState(null)
	const matchUserIds = matches.map(({user_id}) => user_id)
	const getMatces = async ()=>{
		try{
			const response = await axios.get('http://localhost:8000/users/alluser',{
				params:{user_id:JSON.stringify(matchUserIds)}
			})
			matchedProfiles(response.data)

		}
		catch(err){
			console.log(err)
		}
	}

	return (
	  <div className="match-display"></div>
	)
}

export default MatchDisplay
